// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

contract TaxPayment {
    // Define an event that logs payment details
    event TaxPaid(
        address indexed sender,
        address indexed recipient,
        uint amount,
        string senderName,
        string recipientName,
        string panCard
    );

    // Example function to pay tax and emit the event
    function payTax(address recipient, uint amount, string memory senderName, string memory recipientName, string memory panCard) public {
        // [Add your logic here to transfer funds etc.]

        // Emit an event with the payment details
        emit TaxPaid(msg.sender, recipient, amount, senderName, recipientName, panCard);
    }
}
